import React from 'react';
const weekdays = [
"Sunday",
"Monday",
"Tuesday",
"Wednesday",
"Thursday",
"Friday",
"Saturday"
];
class  Month extends React.Component {

    render() { 
        const weekDayList = weekdays.map((weekday) =>{
            return (  
                <Weekdays key={weekdays}  />
                );
        });
        return ( 
            <div>
                <React.Fragment>
                    <div className="weekdayContainer">{weekDayList}</div>
                </React.Fragment>
            </div>
         );
    }
}
 
export default Month;
